import ImageGallery from "../Body/ImageGallery";
import { Fragment } from "react";
import classes from "./Modal.module.css";

const ImageModal = () => {
  return (
    <Fragment>
      <div className={classes.backdrop}>
        <ImageGallery />
      </div>
    </Fragment>
  );
};

export default ImageModal;
